import React from 'react';
import style from './starry.jpg';
import contents from './mountains.jpeg';
import output from './output.png';

const img = {
  width: '450px', 
  height: '450px' 
}

const caption = {
  width: '400px',
  textAlign: 'center'
}

const div = {
  width: '500px',
  height: '620px'
}

const NSTExample = () => {
  return (
    <div className='dib flex-wrap center'>
      <div className='ma4 center dib pa1 ba' style={div}>
        <img className='ma4 center dib pa1 ba' style={ img } src={contents} alt='' />
        <figcaption className='center pa2' style={caption}>Take your favourite picture and grab the image url.</figcaption>
      </div>
      <div className='ma4 center dib pa1 ba' style={div}>
        <img className='ma4 center dib pa1 ba' style={ img } src={style} alt='' />
        <figcaption className='center pa2' style={caption}>Then grab a picture that reflects your favourite artists style.</figcaption>
      </div>
      <div className='ma4 center dib pa1 ba' style={div}>
        <img className='ma4 center dib pa1 ba' style={ img } src={output} alt='' />
        <figcaption className='center pa2 ba' style={caption}>We will run your images through a Neural Style Transfer deep learning model. Which will produce a result like this.</figcaption>
      </div>
    </div>
  );
}

export default NSTExample
